import styled from "styled-components";

const BgFooter = styled.footer`
  padding: 35px 0;
  background: #222;
  width: 100%;
  position: absolute;
  bottom: 0;
  left: 0;
  text-align: center;
  font-size: 15px;
`

const Footer = () => {
    return(
        <BgFooter>
            <h2>Created by <a href={'https://vk.com/homerioni'} target={'_blank'}>Homerion</a></h2>
        </BgFooter>
    );
}

export default Footer;
